import React, { useEffect } from "react";
import { Container, Row, Col } from "react-bootstrap";
import axios from "axios";



function App() {
  const header = {
    "Content-Type": "application/json",
    Accept: "application/json",
  };

  useEffect(() => {
    axios.get("http://127.0.0.1:8761/eureka/apps/", {
      headers: {
        "Content-Type": "application/json",
        "Accept": "application/json"
      }
    })
      .then(res => {
        const data = res.data;
        console.log(data)
      }).catch(error => {
        console.log(error)
      })
  });

  return (
    <Container>
      <Row>
        <Col>
          <h1>Dashboard</h1>
        </Col>
      </Row>
    </Container>
  );
}

export default App;
